Chordizer.C=function(b,a){this.addChord(b,"C",0,a).addMute("LowE").addOpenString(["G","HighE"]).addFretPress(3,"A").addFretPress(2,"D").addFretPress(1,"H")};Chordizer.Cv2=function(b,a){this.addChord(b,"C",5,a).addBarre(1,"D","H").addFretPress(4,["LowE","HighE"]).addFretPress(3,"A")};Chordizer.Cv3=function(b,a){this.addChord(b,"C",3,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["G","D","H"])};Chordizer.Cv4=function(b,a){this.addChord(b,"C",8,a).addBarre(1,"LowE","HighE").addFretPress(2,"G").addFretPress(3,["A","D"])};Chordizer.Cv5=function(b,a){this.addChord(b,"C",10,a).addMute(["LowE","A"]).addFretPress(1,"D").addFretPress(3,["G","HighE"]).addFretPress(4,"H")};Chordizer.Cmaj7=function(b,a){this.addChord(b,"Cmaj7",0,a).addMute("LowE").addOpenString(["G","H","HighE"]).addFretPress(3,"A").addFretPress(2,"D")};Chordizer.Cadd9=function(b,a){this.addChord(b,"Cadd9",0,a).addMute("LowE").addOpenString(["G"]).addFretPress(3,["A","H","HighE"]).addFretPress(2,"D")};Chordizer.Cm=function(b,a){this.addChord(b,"Cm",3,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["G","D"]).addFretPress(2,"H")};Chordizer.Cis=function(b,a){this.addChord(b,"C#",4,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["D","G","H"])};Chordizer.Cism=function(b,a){this.addChord(b,"C#m",4,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["G","D"]).addFretPress(2,"H")};